  return (
    <SuggestWraper>
      <SuggestBox>
        <SuggestBody>
          {/* <Slider {...settings}> */}
          {productlist.map((item) => {
            return (
              <SuggestDymmy
                text={item.text}
                url={item.url}
                price={item.price}
              />
            );
          })}
          {/* </Slider> */}
        </SuggestBody>
      </SuggestBox>
    </SuggestWraper>
  );
}

